import api from '@landinghub/api';

const userApi = {
    getAll: () => api.get("/admin/users"),
    create: (data) => api.post("/admin/users", data),
    update: (id, data) => api.put(`/admin/users/${id}`, data),
    remove: (id) => api.delete(`/admin/users/${id}`),
};

export default userApi;
